import React from 'react'
import {Link, useNavigate } from "react-router-dom"
import './Navb.css';


const menuList=['About',"Service","Contact","Feedback"]



const Navb = () => {
  return (
    <div className='menu-area'>
      <ul className='menu-list'>
      <li><Link><li></li>회사정보</Link></li>
      </ul>
    </div>
  )
}

export default Navb
